        function lookupSku() {
            const skuInput = document.getElementById('skuInput');
            const resultParagraph = document.getElementById('result');
            const sku = skuInput.value.trim(); // Get the input value and remove leading/trailing whitespace

            if (sku === "") {
                resultParagraph.textContent = "";
                return;
            }

            const section = skuData[sku];

            if (section) {
                resultParagraph.textContent = `Section: ${section}`;
            } else {
                resultParagraph.textContent = "SKU not found.";
            }
        }
